INSERT INTO `xmw_international` VALUES ('1435531009759252480', 'router.features.lazyLoad.title', '懒加载', 'Lazyload', '1420297124649766912', '2021-09-08 17:10:38', NULL);
INSERT INTO `xmw_international` VALUES ('1435532430596509696', 'router.features.lazyLoad.content', '图片懒加载核心就是[ 判断当前图片是否到了可视区域 ],基于 IntersectionObserver API来实现了图片的懒加载', 'The core of lazy image loading is to judge whether the current image is in the visible area, and lazy image loading is implemented based on IntersectionObserver API', '1420297124649766912', '2021-09-08 17:16:17', NULL);
INSERT INTO `xmw_international` VALUES ('1435796789247741952', 'router.features.customDirective.lazyLoadTip', '懒加载指令', 'Lazy loading Directive', '1420297124649766912', '2021-09-09 10:46:45', NULL);
INSERT INTO `xmw_international` VALUES ('1435808248526671872', 'router.features.vitualScroll.title', '虚拟滚动', 'Vitual Scroll', '1420297124649766912', '2021-09-09 11:32:17', NULL);
INSERT INTO `xmw_international` VALUES ('1435811389800321024', 'router.features.vitualScroll.content', '虚拟列表是在大数据列表中应用的一种技术，主要是为了减少不可见区域不必要的渲染从而提高性能，特别是数据量在成千上万条效果尤为明显', 'Virtual list is a kind of technology applied in big data list, mainly to reduce the unnecessary rendering of invisible area and improve performance, especially when the amount of data is tens of thousands', '1420297124649766912', '2021-09-09 11:44:46', NULL);
INSERT INTO `xmw_international` VALUES ('1435852080370814976', 'router.features.captcha.title', '验证码', 'Captcha', '1420297124649766912', '2021-09-09 14:26:27', NULL);
INSERT INTO `xmw_international` VALUES ('1435852187044548608', 'router.features.captcha.content', '验证码是一种比较常见的区分用户是计算机还是人的手段,主要是为了保证项目的安全,单纯前端的验证是不安全的，因为可以直接通过接口请求', 'A verification code is a common method to distinguish between a computer and a human user. It is mainly used to ensure project security. Front-end authentication is not secure because it can be directly requested through an interface', '1420297124649766912', '2021-09-09 14:26:52', NULL);
INSERT INTO `xmw_international` VALUES ('1435871576439525376', 'router.features.captcha.generaVerify', '常规验证', 'Genera Verify', '1420297124649766912', '2021-09-09 15:43:55', '2021-09-10 09:29:24');
