INSERT INTO `xmw_news` VALUES ('1433615877475012608', '1420297124649766912', '最新通知！你的工资要涨了！', '<div class=\"details-content-box\">\n<p>来源：南昌广播电视台</p>\n</div>\n<div class=\"details-content-box\">\n<p>9月2日上午，我省2021年企业工资指导线新鲜出炉！</p>\n</div>\n<div class=\"details-content-box\">\n<p>为加强我省企业工资分配的宏观调控，推进企业工资集体协商，促进企业工资分配与国家宏观调控政策相协调，根据有关规定，结合我省2020年国民经济社会发展状况及2021年发展计划，制定我省2021年企业工资指导线，经人力资源社会保障部审核、省政府同意，现予发布。</p>\n<div class=\"details-content-box\">\n<p>一、2021年度企业工资增长基准线为8%；企业工资增长下线为3%；企业工资增长不设上线。上述工资指导线以2020年本企业平均工资为基数，适用于企业职工工资调整和分配。</p>\n</div>\n<div class=\"details-content-box\">\n<p>二、全省各类企业应根据本企业经济效益和劳动生产率的具体情况，按照党的十九大报告提出的&ldquo;坚持在经济增长的同时实现居民收入同步增长、在劳动生产率提高的同时实现劳动报酬同步提高&rdquo;的总体要求及工资指导线的要求，建立健全工资决定和正常增长机制，协商确定2021年度工资增长比例，合理安排工资增长。</p>\n</div>\n<div class=\"details-content-box\">\n<p>（一）国有企业（含国有独资和国有控股企业，下同）应按照国有企业工资决定机制改革的有关规定编制工资总额预算方案，在工资监管部门核准或备案的工资总额预算内，通过与工会开展工资集体协商，合理确定本企业2021年度的职工工资增长幅度和工资水平。</p>\n</div>\n<div class=\"details-content-box\">\n<p>（二）非国有企业应依据工资指导线和劳动报酬增长与劳动生产率提高同步的要求，积极主动地与工会或职工协商代表开展工资集体协商，合理确定本企业2021年度的职工工资增长幅度和工资水平。对经济效益好转、连续两年未增加职工工资的企业，通过集体协商，可以补偿性的、较多的增加职工工资。</p>\n</div>\n<div class=\"details-content-box\">\n<p>三、企业应建立和完善内部工资分配自我约束机制，加强人工成本管理，发挥市场在人力资源配置中的决定性作用，正确处理按劳分配与按生产要素分配的关系，在坚持按劳分配原则的前提下，努力提高一线职工特别是技术工人、农民工的工资水平，使一线职工工资增长不低于本企业平均工资的增长。</p>\n</div>\n<div class=\"details-content-box\">\n<p>四、各级人力资源社会保障行政部门要按规定做好国有企业工资总额执行结果的备案工作，加大对工资指导线和《江西省企业工资集体协商条例》的宣传力度，加强对企业执行情况的检查指导，进一步发挥工资指导线的宏观调控作用，切实增强工资指导线的实施效果和社会影响力，使各类企业通过开展工资集体协商，合理确定2021年工资增长幅度和工资水平，推动经济社会发展。</p>\n</div>\n</div>', '2021-09-03 10:20:35', NULL, 'news', '1', '0');
