INSERT INTO `xmw_news` VALUES ('1433639305800192000', '1420297124649766912', '天猫公布今年双11节奏', '<p>金融界网9月2日消息，阿里巴巴副总裁、天猫副总裁吹雪在阿里妈妈m峰会上正式公布了今年双11节奏。 吹雪介绍，今年双11和去年一样，依旧保持「双节棍」的节奏设计，分两个阶段售卖。两个售卖期时间分别是11月1&mdash;&mdash;3日和11月11日。</p>\n<p>与此对应，今年预售的时间也分两波进行。消费者预售不用再熬夜，两波预售时间都提前到了晚上20点进行：10月20日晚20点启动第一波预售，11月4日晚20点开启第二波预售。</p>\n<p>本文源自金融界网</p>', '2021-09-03 11:53:40', NULL, 'news', '1', '0');
INSERT INTO `xmw_news` VALUES ('1433681281966804992', '1420297124649766912', '腾讯再无周杰伦“独家版权”', '<p>近日，腾讯正式发布了放弃所有音乐版权独家授权权利的声明。终于，我们很可能将告别听歌遇到平台无版权不能听，歌单变灰，得安装多个音乐平台的APP才能把喜欢的歌听完整的极其糟糕的音乐体验。</p>\n<p data-track=\"3\">说到腾讯音乐的独家版权，我想很多人第一个想到的就是周杰伦了，毕竟周杰伦到现在依旧是火到没边，说一句周杰伦目前仍是华语乐坛的第一人，估计没什么人反对吧...所以他的音乐版权归属是能够给音乐平台带来极大的影响的。大家也知道，这些年来腾讯一直是周杰伦独家版权的拥有者。当然了，这个版权指的是互联网独家版权，而音乐版权其实是分为互联网版权和运营商版权两种。所以大家会发现从中国移动旗下的音乐平台【咪咕音乐】也可以听到周杰伦的正版歌曲，电信和联通各自旗下的天翼音乐、沃音乐可以听到腾讯的其它独家互联网版权歌曲也是同样的道理。</p>\n<p data-track=\"5\">所以，腾讯音乐此前所拥有的独家版权，带来的影响更多的是指同类需要互联网音乐版权的平台，譬如网易云音乐。所以，昨天这个消息一出，很多网易云音乐的用户欢呼雀跃：网易云终于又可以听周董了？</p>\n<p data-track=\"7\">理论上是的，但其实也没有那么简单。</p>', '2021-09-03 14:40:28', NULL, 'news', '1', '0');
INSERT INTO `xmw_news` VALUES ('1433683208981057536', '1420297124649766912', '安徽小伙要告《扫黑风暴》！已委托律师', '<p>最近，电视剧《扫黑风暴》在腾讯视频以及东方卫视热播，众多市民大呼看得过瘾，然而，<strong>安徽太湖县的王先生在看剧时，发现片头有8秒钟画面与自己拍摄的视频极其相似。</strong></p>\n<p><strong>王先生认为该剧未经过他同意就使用了他的素材，涉嫌侵权，目前他已经委托律师展开维权。</strong></p>\n<p><strong>太湖一摄影师称《扫黑风暴》</strong></p>\n<p><strong>用了他的素材</strong></p>\n<p>电视剧《扫黑风暴》的热播，成了大家茶余饭后讨论的话题，众多市民认为这是一部好剧，值得推荐，王先生近日也在朋友的推荐下追起剧来。</p>\n<p>因为没有会员，王先生只能从片头开始看起，然而，在腾讯视频上点播后他发现，片头刚开始就出来了一个让他非常熟悉的画面，接着，在片头20多秒的地方，另一个画面再次吸引他的注意。</p>\n<p>王先生发现，<strong>该剧的片头有两段画面一共8秒钟，与自己去年拍摄的素材非常相似。</strong>刚开始王先生还以为只是差不多而已，但经过他仔细对比，发现这8秒钟与自己的素材几乎一样。</p>\n<p>&ldquo;去年我拍的一段延时素材，因为桌椅背景等现场是我自己进行布置的，<strong>我比对之后，确定片头用的就是我拍摄的素材。&rdquo;</strong>王先生表示，自己是当地的一名摄影师，平时喜欢摄影摄像，上述素材的拍摄地点是老家太湖县徐桥镇，当时是在其伯伯家的老房子里拍的，&ldquo;用老物件简单布置了现场，拍摄了一组光影变幻的延时画面，花了半天的时间。&rdquo;</p>', '2021-09-03 14:48:08', NULL, 'news', '1', '0');
